import React from "react";
import '../styles.css';
import ReactList from 'react-list';
// ^This will be used to link to the sign up page

function Examples() {
    const examples = [<div className="containerBlock"><h3>Example Query 1</h3></div>,
                      <h3>Example Query 2</h3>,
                      <h3>Example Query 3</h3>,
                      <h3>Example Query 4</h3>,
                      <h3>Example Query 5</h3>,
                     ]
    function renderItem(index, key) {
        return <div key={key}>{examples[index]}</div>
    }

    return (
        <div className = 'page'>
            <h1>Examples</h1>
                <div className = 'loginblock' style={{height: '50%', top: '40%'}}>
                    <div style={{overflow: 'auto', maxHeight:400}}>
                        <ReactList
                            itemRenderer={renderItem}
                            length={examples.length}
                            type='uniform'
                        />
                    </div>
                </div>
        </div>
    )
}

export default Examples;
